import Header from "./components/Header.js";
import Layout from "./components/MyLayout";
import Head from "next/head";

const Index = () => (
  <div>
    <Head>
      <style>{`
    body {
      margin: 0;
    }
  `}</style>
    </Head>
    <Layout>
      <div>Hello</div>
      <style jsx>
        {`
          body {
            margin: 0;
          }
        `}
      </style>
    </Layout>
  </div>
);

export default Index;
